import '../App.css'
import skills from './Sinfo'
export default function Skills(){
    return(
        <div className='skillsection'>
            <b style={{fontSize:'10vh'}}>Skills</b><hr/>
            <section>
                {skills.map((instance)=>
                    <div style={{width:'clamp(500px,50%,720px)'}}>
                        <h1>{instance.name}</h1>
                        <p className='description'>{instance.des}</p>
                        <div className="progress-bar">
                            <div className="progress-fill" style={{width: `${instance.progress}%`}}></div><p style={{transform:`translateX(${instance.progress}%)`}}>{instance.progress}%</p>
                        </div>
                    </div>
                )}
            </section>
        </div>
    )
}
